import { NgModule } from '@angular/core';

import { RouterModule, Routes } from '@angular/router';
import { GroceryProductsListComponent } from './Component/grocery-products-list/grocery-products-list.component';
import { AddProductComponent } from './Component/add-product/add-product.component';
import { ViewCartListComponent } from './Component/view-cart-list/view-cart-list.component';
import { MyOrderListComponent } from './Component/my-order-list/my-order-list.component';
import { ProductDetailPageComponent } from './Component/product-detail-page/product-detail-page.component';
import { UpdateProductListComponent } from './Component/update-product-list/update-product-list.component';

import { UserRegisterComponent } from './Component/user-register/user-register.component';
import { LoginComponent } from './Component/login/login.component';


const routes: Routes = [

  {
    component: GroceryProductsListComponent,
    path:'',
    pathMatch:'full'

  },
  {
    component: ProductDetailPageComponent,
    path:'productDetail'

  },
  {
    component: UpdateProductListComponent,
    path:'UpdateProduct/:id'

  },

  {

    component:AddProductComponent,
    path:'AddProduct'
  },
  {
    component: ViewCartListComponent,
    path:'ViewCart'

  },
  {
    component: MyOrderListComponent,
    path:'MyOrders'

  },
  {
    component: UserRegisterComponent,
    path:'Signup'

  },
  {
    component: LoginComponent,
    path:'Login'

  }

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
